import axios from "axios"
import { useState, useEffect } from "react";
import classes from "../component/properties/products/PropertyItem.module.css"


const [isLoading, setIsLoading] = useState(true);
const [loadedProp, setLoadedProp] = useState([]);


function SupplyOrderPage() {
    useEffect(() => {
        setIsLoading(true);
        axios.get("http://localhost:3000/locations/")
        .then((response) => {
          setLoadedProp(response.data)
          return response.data.product
        })
        .then(() => {
          setIsLoading(false)
        });
    
      }, []);

      if(isLoading){
        return (
          <section>
            <p>
              loading...
            </p>
          </section>
        );
      }
      return (
        <section>
          
          <h1>all products</h1>
          <div className={classes.actions}>
              <button>Generate supply order</button>
            </div>
        </section>
      );

}

export default SupplyOrderPage;
